Definition of c-Concave: Let $(\mathcal{M}, g)$ be a smooth compact Riemannian manifold without boundary, and $c(x,y)=\frac{1}{2}d(x,y)^2$, where $d(x,y)$ is the intrinsic distance function on the manifold. A function $\phi:\mathcal{M}\rightarrow \mathbb{R}\cup\{-\infty\}$ is $c$-concave if it is not identically $-\infty$ and there exists $\psi:\mathcal{M}\rightarrow\mathbb{R}\cup\{\pm \infty\}$ such that
  \begin{equation}
      \phi(x)=\inf_{y\in\mathcal{M}} (c(x,y)+\psi(y))
  \end{equation}

