Definition of Covering Number: Given a metric space $(\mathcal{S}, \rho)$, and a subset $\tilde{\mathcal{S}} \subset \mathcal{S}$, we say that a subset $\hat{\mathcal{S}}$ of $\tilde{\mathcal{S}}$ is a $\epsilon$-cover of $\tilde{\mathcal{S}}$, if $\forall \tilde{s} \in \tilde{\mathcal{S}}$, $\exists \hat{s} \in \hat{\mathcal{S}}$ such that $\rho(\tilde{s}, \hat{s}) \leq \epsilon$. The $\epsilon$-covering number of $\tilde{\mathcal{S}}$ is
    \begin{displaymath}
        \mathcal{N}_{\epsilon}(\tilde{\mathcal{S}}, \rho) = \min\{ |\hat{\mathcal{S}}|:
        \hat{\mathcal{S}} \text{ is an } \epsilon\text{-covering of } \tilde{\mathcal{S}} \} .
    \end{displaymath}

