Definition of $(\rho, \epsilon)$-Adversarial Robustness: Given a multi-class classifier $f: \mathcal{X} \rightarrow \mathbb{R}^{L}$, and a metric $\rho$ on $\mathcal{X}$, where $L$ is the number of classes, $f$ is said to be adversarially robust w.r.t. adversarial perturbation of strength $\epsilon$, if there exists an $\epsilon > 0$ such that $\forall z = (\boldsymbol{x}, y) \in \mathcal{Z}$ and $ \delta\boldsymbol{x} \in \{\rho(\delta \boldsymbol{x}) \leq \epsilon \}$, we have
    \begin{displaymath}
        f_{\hat{y}}(\boldsymbol{x} + \delta\boldsymbol{x}) - f_{i}(\boldsymbol{x} + \delta\boldsymbol{x}) \geq 0,
    \end{displaymath}
    where $\hat{y} = \arg\max_{j}f_j(\boldsymbol{x})$ and $i \not= \hat{y} \in \mathcal{Y}$.

