Definition of Margin Operator: A margin operator $\mathcal{M}: \mathbb{R}^{L} \times \{1, \ldots, L\} \rightarrow \mathbb{R}$ is defined as
    \begin{displaymath}
        \mathcal{M}(\boldsymbol{s}, y) := s_{y} - \max_{i\not= y}s_{i}
    \end{displaymath}

