Definition of Ramp Loss: The ramp loss $l_{\gamma}: \mathbb{R} \rightarrow \mathbb{R}^{+}$ is defined as
    \begin{displaymath}
        l_{\gamma} (r) :=
        \begin{cases}
        0            & r < -\gamma        \\
        1 + r/\gamma & r \in [-\gamma, 0] \\
        1            & r > 0
        \end{cases}
    \end{displaymath}

