Definition of Ramp Risk: Given a classifier $f: \mathcal{X} \rightarrow \mathbb{R}^{L}$, ramp risk is the risk defined as
    \begin{displaymath}
        R_{\gamma}(f) := \mathbb{E}(l_{\gamma}(- \mathcal{M}(f(X), Y))),
    \end{displaymath}
    where $X, Y$ are random variables in the instance space $\mathcal{Z}$.

