Definition of Smallest Instance-Space Margin: Given an element $z = (\boldsymbol{x}, y) \in \mathcal{Z}$, let $v(\boldsymbol{x})$ be the distance from $\boldsymbol{x}$ to its closest point on the decision boundary, i.e., the instance-space margin (IM) of example $\boldsymbol{x}$. Given a covering set $\hat{S}$ of $\mathcal{Z}$, let
\begin{equation}
  v_{\min} = \min_{\boldsymbol{x} \in \{\boldsymbol{x} \in \mathcal{X} |  \exists
    \boldsymbol{x}' \in \hat{S}_m, ||\boldsymbol{x} - \boldsymbol{x}'||_2 \leq \epsilon\}} v(\boldsymbol{x}),
\end{equation}
where $\hat{S}_m := \{\boldsymbol{x}' \in \hat{S} | \exists \boldsymbol{x}_i \in S_m, ||\boldsymbol{x}_i - \boldsymbol{x}'||_2 \leq \epsilon \}$. $v_{\min}$ is the smallest instance-space margin of elements in the covering balls that contain training examples.

