Definition of Spectral Complexity: Spectral complexity $\text{SC}(T)$ of a NN $T$ is the multiplication of spectral norms of weight matrices of layers in a NN.
    \begin{displaymath}
      \text{SC}(T) = \prod_{i=1}^{L}||\boldsymbol{W}_{i}||_2
    \end{displaymath}
    where $\{\boldsymbol{W}_{i}\}_{i=1\ldots L}$ denotes weight matrices of layers of the NN.

