Definition of $(K, \epsilon(\cdot))$-Robust: An algorithm is $(K, \epsilon(\cdot))$ robust, for $K \in \mathbb{N}$ and $\epsilon(\cdot): \mathcal{Z}^{m} \mapsto \mathbb{R}$, if $\mathcal{Z}$ can be partitioned into $K$ disjoint sets, denoted by $\mathcal{C} = \{ C_k \}_{k=1}^{K}$, such that the following holds for all $s_i = (\boldsymbol{x}_i, y_i) \in S_m, z=(\boldsymbol{x}, y) \in \mathcal{Z}, C_k \in \mathcal{C}$:
\begin{align*}
    \forall s_i = (\boldsymbol{x}_i, y_i) \in C_k, \forall z=(\boldsymbol{x}, y) \in C_k \\
    \implies |l(f(\boldsymbol{x}_i), y_i) - l(f(\boldsymbol{x}), y)| \leq \epsilon(S_m).
\end{align*}

