Definition of Differentially Private: A randomized algorithm $\mathcal{M}$ is $(\epsilon, \delta)$-differentially private for $\epsilon > 0$ and $\delta \in (0,1)$ if, for all  $O \subset \text{Range}(\mathcal{M})$ (where $\text{Range}(\mathcal{M})$ is the range of the outputs of the randomized algorithm $\mathcal{M}$) and for all neighboring datasets $\mathcal{X} $ and $\mathcal{X} '$, we have that
    \begin{equation*}
    P(\mathcal{M}(\mathcal{X} ) \in O) \le \exp (\epsilon) \cdot P(\mathcal{M}(\mathcal{X} ') \in O) + \delta.
    \end{equation*}

