Definition of Diagonal Dominance: Let a dataset $\mathcal{X}  \subset \mathbb{R}^{d}$ and a set $\mathcal{X}_0 \subseteq \mathcal{X}$ be given. The covariance matrix $K_{\mathcal{X}_0 \mathcal{X}_0}$ is said to be diagonally dominant if for any $x \in \mathcal{X}_0$
    \begin{equation*}
    k_{x x} \geq \big( \sqrt{| \mathcal{X}_0 |  -1} + 1 \big) \sum \nolimits_{x' \in \mathcal{X}_0 \setminus  x } k_{x x'}.
    \end{equation*}

