Definition of Heavy-Tailed Random Variable: A random variable $X$ is heavy-tailed if it does not admit a finite moment generating function, i.e., there is no $u_0>0$ such that,
\begin{equation*}
    \forall |u| \leq u_0, \ M_X(u) \triangleq \mathbb E[\exp(uX)] < \infty.
\end{equation*}

