Definition of Trimmed Mean: Consider $n$ copies $X_1, ..., X_n$ of a heavy-tailed random variable $X$ such that $\mathbb E[X] = \mu, \mathbb E[X^{1+\varepsilon}]\leq u$ for some $\varepsilon\in(0, 1]$. The online trimmed mean, for some $\delta \in (0, 1)$ is defined as
\begin{equation*}
    \hat{\mu}_O = \frac{1}{n}\sum_{i=1}^n X_i \bm{1}\left\{|X_i| \leq \left(\frac{ui}{\log \delta^{-1}}\right)^{\frac{1}{1+\varepsilon}}\right\}.
\end{equation*}
